import React from 'react';
import moment from 'moment-timezone';
import './Horloge.css';

class Clock extends React.Component{

	render(){

		return(
			<div>
				<h2>It is { this.props.date.toLocaleTimeString() }</h2>
			</div>
		)
	}

}

const Horloge = (props) => {


	return(
			<Clock date={new Date()}/>
		)


}
export default Horloge;
